// TableauChart.js

import React, { useEffect } from 'react';

const TableauChart = () => {
  useEffect(() => {
    // Function to initialize Tableau Viz
    const initViz = () => {
      const containerDiv = document.getElementById('tableauViz');
      const url = 'https://public.tableau.com/views/YourTableauWorkbook/YourDashboard';
      const options = {
        width: '800px',
        height: '600px',
        hideTabs: true,
        hideToolbar: true,
      };
      const viz = new window.tableau.Viz(containerDiv, url, options);
    };

    // Load the Tableau JavaScript API
    const script = document.createElement('script');
    script.src = 'https://public.tableau.com/javascripts/api/tableau-2.min.js';
    script.async = true;
    script.onload = initViz; // Call initViz after the script has loaded
    document.head.appendChild(script);

    // Cleanup function to remove the script when the component unmounts
    return () => {
      document.head.removeChild(script);
    };
  }, []); // Empty dependency array to run the effect once on mount

  return <div id="tableauViz" />;
};

export default TableauChart;
